import React from 'react'

export default function Camera() {
    return(
        <h1>Camera</h1>
    )
}

import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          Front-End for Aiko
      </header>
    </div>
  );
}
